//获取应用实例
const app = getApp()
var subwayName = {};
var autoResults;

Page({
  data: {
    userInfo: {},
    hasUserInfo: false,
    canIUse: wx.canIUse('button.open-type.getUserInfo'),
    subwayName: '',
    linelist: {}, 
    autoResults: new Array(), 
    inputShowed: false,
    autoShowed: false,
  },
  showInput: function () {
    this.setData({
      inputShowed: true
    });
  },
  hideInput: function () {
    this.setData({
      subwayName: "",
      inputShowed: false
    });
    this.setData({
      linelist: new Array()
    });
    this.autoinput();
  },
  clearInput: function () {
    this.setData({
      subwayName: ""
    });
    this.setData({
      linelist: new Array()
    });
    this.autoinput();

  },
  subwayNameInput: function (e) {    
      this.setData({
        subwayName: e.detail.value
      });
      this.autoinput();
      this.setData({
        autoShowed: false
      });
  },
  autoinput: function(){
    this.setData({
      linelist: new Array()
    });

    var tempArry = new Array();
    if (this.data.subwayName!='')
    {
      for (var i = 0; i < allstations.length; i++) {
        if (allstations[i].indexOf(this.data.subwayName) > -1) {
          tempArry.push(allstations[i]);
          if (tempArry.length == 3) {
            break;            
          }
        }
      }      
    }  

    this.setData({
      autoResults: tempArry
    });
    
  },
  showmap: function(e){
    this.setData({
      subwayName: e.currentTarget.dataset.text,
      autoShowed:true,
    });
    //console.log(e.currentTarget.dataset.text);
    var stationName = this.data.subwayName;
    if (stationName =='')
    {
      return;
    }
    var stationArr = allTimesheet[stationName]; 
    var wcInfArr = new Array(); 
    
    var tempwcInfoArr = allwcJson[stationName].toString().split(' ');
    //console.log(JSON.stringify(tempwcInfoArr));
    if (tempwcInfoArr != null) {
      for (var i = 0; i < tempwcInfoArr.length; i++) {
        wcInfArr.push(tempwcInfoArr[i] + ' ' + tempwcInfoArr[i + 1] + ' ' + tempwcInfoArr[i + 2]);
        i = i + 2;
      }
    }
     
    //console.log(wcInfArr[0]);
    var temparry = new Array();
    this.setData({
      linelist: temparry
    });

    if (stationArr != null)
    {
      for (var i = 0; i < stationArr.length; i++) {
        var lineName = Object.keys(stationArr[i]);
        var item = new Object();
        item["lineName"] = lineName;
        console.log(lineName);
        let tempName = lineName.toString();
        let lineNum = tempName === '机场磁悬浮' ? '2' : tempName.match(/\d+/)[0];
        item["stationlist"] = stationArr[i][lineName];
        item["wc"] = wcInfArr[i];
        item["lineColor"] = colorMap[lineNum];
        temparry.push(item);
        //console.log("msg"+JSON.stringify(stationArr[i]));
      }

      this.setData({
        linelist: temparry
      });
    }else
    {
      this.openToast();
    }
    
    //console.log(JSON.stringify(allwcJson[this.data.subwayName]));
   // console.log("name：" + this.data.subwayName + JSON.stringify(stationArr[0]));
  },
  //事件处理函数
  bindViewTap: function() {
    wx.navigateTo({
      url: '../logs/logs'
    })
  },
  onLoad: function () {
    if (app.globalData.userInfo) {
      this.setData({
        userInfo: app.globalData.userInfo,
        hasUserInfo: true
      })
    } else if (this.data.canIUse){
      // 由于 getUserInfo 是网络请求，可能会在 Page.onLoad 之后才返回
      // 所以此处加入 callback 以防止这种情况
      app.userInfoReadyCallback = res => {
        this.setData({
          userInfo: res.userInfo,
          hasUserInfo: true
        })
      }
    } else {
      // 在没有 open-type=getUserInfo 版本的兼容处理
      wx.getUserInfo({
        success: res => {
          app.globalData.userInfo = res.userInfo
          this.setData({
            userInfo: res.userInfo,
            hasUserInfo: true
          })
        }
      })
    }

    
  },
  onReady: function () {
    //this.showmap()
  },
  getUserInfo: function(e) {
    console.log(e)
    app.globalData.userInfo = e.detail.userInfo
    this.setData({
      userInfo: e.detail.userInfo,
      hasUserInfo: true
    })
  },
  openToast: function () {
    wx.showToast({
      title: '已完成',
      icon: 'success',
      duration: 3000
    });
  },
})

